import React from 'react'
import { useRouter } from 'next/router';

const USER = () => {
    const router = useRouter();
    const { id } = router.query;
    return (
        <div>
            유저 아이디로 포스팅 조회 하기 <br />
            id: {id}
        </div>
    )
}

export default USER
